{"post_stream":{"posts":[{"id":3345882,"name":null,"username":"anon89179308","avatar_template":"/letter_avatar_proxy/v4/letter/a/77aa72/{size}.png","created_at":"2024-03-28T01:07:42.387Z","cooked":"<p>I’m using commands.sequence() to stitch together an autonomous procedure for our robot. This includes SwerveControllerCommands that cause the robot to follow a trajectory and inbetween those SwerveControllerCommands I’m running other commands (such as raising or lowering an intake, shooting, etc). There is a problem with that the robot will not reach its end destintion (or maybe it is but it just doesn’t stop) and the next command in the sequence occurs.</p>
<p>For example, I tell the robot to lower its intake and move to a note, then once done moving to the note to raise the intake (basically just picking up the intake). The robot lowers the intake, starts moving to the note, before it gets there it raises the intake while still moving from the SwerveControllerCommand. This also I think may be cascading into a huge backlog of just autonomous commands off sync.</p>
<p>I have multiple theories: maybe the floor is just really slippery (we were testing this on tiles and slippery floors have been a problem with teleop driving before) or that I have a skewed understanding of how commands.sequence() and the SwerveControllerCommand works.</p>
<p>One last note it does work sometimes perfectly, other times only one part of the autonomous procedure may happen too early, other times the whole thing is wack.</p>
<p>Thanks</p>
